import React, { useState, useEffect } from "react";
import { Card, Button, Image, Header, Modal } from "semantic-ui-react";
import { connect } from "react-redux";
import { withRouter } from "react-router-dom";

function GroupSearchItem(props) {
  return (
    <div>
      <Card style={{ display: "inline-block" }}>
        <Card.Content>
          <Card.Header>{props.group.title}</Card.Header>
          <Card.Meta>
            <span>By: {props.book.author}</span>
          </Card.Meta>
        </Card.Content>
      </Card>
    </div>
  );
}

const mapStateToProps = (state) => {
  return {
    mostPopular: state.books.mostPopular,
    searchedBooks: state.books.searchedBooks,
  };
};

export default withRouter(connect(mapStateToProps)(BookSearchItem));
